import React, { Component } from "react";
import Card from "./Card";
import memberInfo from "./info";

class Team extends Component {
  constructor() {
    super();
    this.state = { info: memberInfo };
  }

  mapping(x) {
    const members = x.map((member) => (
      <Card
        image={member.image}
        key={member.id}
        name={member.name}
        position={member.position}
        born={member.born}
        height={member.height}
        nationality={member.nationality}
      />
    ));
    return members;
  }

  render() {
    return (
      <div className="row mt-5 justify-content-center align-item-center gap-3">
        <button className="btn btn-close-white"> Add Player</button>
        {this.mapping(this.state.info)}
      </div>
    );
  }
}

export default Team;
